SELECT MAX("cast_info"."movie_id") as agg_0, MIN("title"."production_year") as agg_1 FROM "char_name" LEFT OUTER JOIN "cast_info" ON "char_name"."id" = "cast_info"."person_role_id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id" LEFT OUTER JOIN "aka_name" ON "cast_info"."person_id" = "aka_name"."id"  WHERE "title"."id" BETWEEN 279286 AND 433160 AND "aka_name"."person_id" <= 1786487 AND "aka_name"."name_pcode_cf" NOT LIKE '%A%5362%' AND "title"."kind_id" >= 1;